create table Users (
	ID BIGINT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Email varchar(80) NOT NULL,
    Username varchar(50) not null,
    Password varchar(80) not null 
);

create table Movies (
	ID BIGINT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Title varchar(100) not null,
    ReleaseYear int,
    LocationURI varchar(200),
    Price int not null
);


